import { useState } from "react";

const categories = [
  "FREE",
  "WORKS", 
  "FARMERS",
  "RESTAURANTS",
  "HOME & CARE",
  "HOBBYISTS",
  "KIDS"
];

export default function Home() {
  const [tryClicked, setTryClicked] = useState(false);

  const handleTryClick = () => {
    setTryClicked(true);
    setTimeout(() => setTryClicked(false), 300);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 via-green-50 to-gray-100 overflow-hidden">
      {/* Background Decorative Circles */}
      <div className="fixed inset-0 pointer-events-none">
        <div className="absolute top-10 left-10 w-32 h-32 bg-stoq-green/20 rounded-full animate-float"></div>
        <div className="absolute top-20 right-20 w-24 h-24 bg-yellow-200/30 rounded-full animate-float-delay-1"></div>
        <div className="absolute bottom-20 left-20 w-40 h-40 bg-stoq-light/40 rounded-full animate-float-delay-2"></div>
        <div className="absolute bottom-32 right-32 w-28 h-28 bg-green-200/25 rounded-full animate-float-delay-3"></div>
        <div className="absolute top-1/2 left-1/4 w-20 h-20 bg-yellow-100/40 rounded-full animate-float-delay-4"></div>
        <div className="absolute top-1/3 right-1/3 w-36 h-36 bg-stoq-green/15 rounded-full animate-float"></div>

        {/* Medium circles */}
        <div className="absolute top-1/4 left-1/2 w-16 h-16 bg-green-300/20 rounded-full animate-float-delay-1"></div>
        <div className="absolute bottom-1/4 right-1/4 w-12 h-12 bg-yellow-300/25 rounded-full animate-float-delay-3"></div>
        <div className="absolute top-3/4 left-1/3 w-14 h-14 bg-stoq-light/30 rounded-full animate-float"></div>

        {/* Small accent circles */}
        <div className="absolute top-16 left-1/3 w-8 h-8 bg-stoq-green/30 rounded-full animate-float-delay-2"></div>
        <div className="absolute bottom-16 right-1/3 w-6 h-6 bg-yellow-400/20 rounded-full animate-float-delay-4"></div>
      </div>

      {/* Main Container */}
      <div className="min-h-screen flex flex-col items-center justify-center relative">
        {/* STOQ Logo Container */}
        <div className="relative">
          {/* Main Logo */}
          <div className="relative flex items-center justify-center">
            <div className="relative flex items-center">
              {/* S */}
              <span className="text-8xl md:text-9xl lg:text-[12rem] xl:text-[14rem] font-black text-stoq-green leading-none tracking-tight" style={{ fontFamily: 'Impact, Arial Black, sans-serif' }}>
                S
              </span>

              {/* T */}
              <span className="text-8xl md:text-9xl lg:text-[12rem] xl:text-[14rem] font-black text-stoq-green leading-none tracking-tight" style={{ fontFamily: 'Impact, Arial Black, sans-serif' }}>
                T
              </span>

              {/* O with Dark Circle and Animated Bubbles */}
              <div className="relative inline-block">
                <span className="text-8xl md:text-9xl lg:text-[12rem] xl:text-[14rem] font-black text-stoq-green leading-none tracking-tight" style={{ fontFamily: 'Impact, Arial Black, sans-serif' }}>
                  O
                </span>

                {/* Dark Green Circle inside O */}
                <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-16 h-16 md:w-20 md:h-20 lg:w-28 lg:h-28 xl:w-32 xl:h-32 bg-stoq-dark rounded-full shadow-lg"></div>

                {/* Animated Bubbles Container */}
                <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-16 h-16 md:w-20 md:h-20 lg:w-28 lg:h-28 xl:w-32 xl:h-32 overflow-visible">
                  {categories.map((category, index) => (
                    <div
                      key={category}
                      className={`absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-16 h-16 md:w-20 md:h-20 lg:w-28 lg:h-28 xl:w-32 xl:h-32 bg-white rounded-full shadow-md flex items-center justify-center z-10 ${
                        index === 0 ? 'animate-bubble-rise' :
                        index === 1 ? 'animate-bubble-rise-delay-1' :
                        index === 2 ? 'animate-bubble-rise-delay-2' :
                        index === 3 ? 'animate-bubble-rise-delay-3' :
                        index === 4 ? 'animate-bubble-rise-delay-4' :
                        index === 5 ? 'animate-bubble-rise-delay-5' :
                        'animate-bubble-rise-delay-6'
                      }`}
                    >
                      <span className="text-xs md:text-sm lg:text-base xl:text-lg font-bold text-stoq-dark text-center px-1">
                        {category}
                      </span>
                    </div>
                  ))}
                </div>
              </div>

              {/* Q with TRY Button */}
              <div className="relative inline-block">
                <span className="text-8xl md:text-9xl lg:text-[12rem] xl:text-[14rem] font-black text-stoq-green leading-none tracking-tight" style={{ fontFamily: 'Impact, Arial Black, sans-serif' }}>
                  Q
                </span>

                {/* TRY Button inside Q */}
                <button 
                  onClick={handleTryClick}
                  className={`absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-12 h-12 md:w-16 md:h-16 lg:w-20 lg:h-20 xl:w-24 xl:h-24 bg-stoq-dark rounded-full shadow-lg flex items-center justify-center hover:shadow-xl transition-shadow duration-200 cursor-pointer z-20 ${
                    tryClicked ? 'animate-try-click' : ''
                  }`}
                >
                  <span className="text-xs md:text-sm lg:text-base xl:text-lg font-bold text-white">
                    TRY
                  </span>
                </button>
              </div>
            </div>
          </div>

          {/* Tagline */}
          <div className="text-center mt-8 md:mt-12">
            <h2 className="text-2xl md:text-3xl lg:text-4xl xl:text-5xl font-bold text-stoq-dark tracking-wide">
              SEE. DO. GROW
            </h2>
          </div>
        </div>
      </div>
    </div>
  );
}
